  summary: "\nLocks the cache, adds the provided <span class=\"paramref\">aggregate</span> to the cache if not already in it, then calls <xref href=\"Cqrs.Domain.IAggregateRepository%601.Save%60%601(%60%600%2cSystem.Nullable%7bSystem.Int32%7d)\" data-throw-if-not-resolved=\"false\"></xref> on <xref href=\"Cqrs.Cache.CacheRepository%601.Repository\" data-throw-if-not-resolved=\"false\"></xref>.\nIn the event of an <xref href=\"System.Exception\" data-throw-if-not-resolved=\"false\"></xref> the <span class=\"paramref\">aggregate</span> is always ejected out of the <xref href=\"Cqrs.Cache.CacheRepository%601.Cache\" data-throw-if-not-resolved=\"false\"></xref>.\n"
  example: []
  syntax:
    content: 'public virtual void Save<TAggregateRoot>(TAggregateRoot aggregate, int ? expectedVersion = null)where TAggregateRoot : IAggregateRoot<TAuthenticationToken>'
    parameters:
    - id: aggregate
      type: '{TAggregateRoot}'
      description: The <xref href="Cqrs.Domain.IAggregateRoot%601" data-throw-if-not-resolved="false"></xref> to save and persist.
    - id: expectedVersion
      type: System.Nullable{System.Int32}
      description: The version number the <xref href="Cqrs.Domain.IAggregateRoot%601" data-throw-if-not-resolved="false"></xref> is expected to be at.
    typeParameters:
    - id: TAggregateRoot
      description: The <xref href="System.Type" data-throw-if-not-resolved="false"></xref> of the <xref href="Cqrs.Domain.IAggregateRoot%601" data-throw-if-not-resolved="false"></xref>.
