    id: Get
    path: Framework/Cqrs/Cache/CacheRepository.cs
    startLine: 107
  assemblies:
  - Cqrs
  namespace: Cqrs.Cache
  summary: "\nLocks the cache, checks if the aggregate is tracked in the <xref href=\"Cqrs.Cache.CacheRepository%601.Cache\" data-throw-if-not-resolved=\"false\"></xref>, if it is\nretrieves the aggregate from the <xref href=\"Cqrs.Cache.CacheRepository%601.Cache\" data-throw-if-not-resolved=\"false\"></xref> and then uses either the provided <span class=\"paramref\">events</span> or makes a call <xref href=\"Cqrs.Events.IEventStore%601.Get(System.Type%2cSystem.Guid%2cSystem.Boolean%2cSystem.Int32)\" data-throw-if-not-resolved=\"false\"></xref> on the <xref href=\"Cqrs.Cache.CacheRepository%601.EventStore\" data-throw-if-not-resolved=\"false\"></xref>\nand rehydrates the cached aggregate with any new events from it&apos;s cached version.\nIf the aggregate is not in the <xref href=\"Cqrs.Cache.CacheRepository%601.Cache\" data-throw-if-not-resolved=\"false\"></xref>\n<xref href=\"Cqrs.Domain.IAggregateRepository%601.Get%60%601(System.Guid%2cSystem.Collections.Generic.IList%7bCqrs.Events.IEvent%7b%600%7d%7d)\" data-throw-if-not-resolved=\"false\"></xref> is called on the <xref href=\"Cqrs.Cache.CacheRepository%601.Repository\" data-throw-if-not-resolved=\"false\"></xref>.\n"
  example: []
  syntax:
    content: 'public virtual TAggregateRoot Get<TAggregateRoot>(Guid aggregateId, IList<IEvent<TAuthenticationToken>> events = null)where TAggregateRoot : IAggregateRoot<TAuthenticationToken>'
    parameters:
    - id: aggregateId
      type: System.Guid
      description: The ID of the <xref href="Cqrs.Domain.IAggregateRoot%601" data-throw-if-not-resolved="false"></xref> to get.
    - id: events
      type: System.Collections.Generic.IList{Cqrs.Events.IEvent{{TAuthenticationToken}}}
      description: "\nA collection of <xref href=\"Cqrs.Events.IEvent%601\" data-throw-if-not-resolved=\"false\"></xref> to replay on the retrieved <xref href=\"Cqrs.Domain.IAggregateRoot%601\" data-throw-if-not-resolved=\"false\"></xref>.\nIf null, the <xref href=\"Cqrs.Events.IEventStore%601\" data-throw-if-not-resolved=\"false\"></xref> will be used to retrieve a list of <xref href=\"Cqrs.Events.IEvent%601\" data-throw-if-not-resolved=\"false\"></xref> for you.\n"
    typeParameters:
    - id: TAggregateRoot
      description: The <xref href="System.Type" data-throw-if-not-resolved="false"></xref> of the <xref href="Cqrs.Domain.IAggregateRoot%601" data-throw-if-not-resolved="false"></xref>.
    return:
      type: '{TAggregateRoot}'
    content.vb: Public Overridable Function Get(Of TAggregateRoot As IAggregateRoot(Of TAuthenticationToken))(aggregateId As Guid, events As IList(Of IEvent(Of TAuthenticationToken)) = Nothing) As TAggregateRoot
